import { Route, Routes } from 'react-router';
import './App.css';
import Navbar from './components/Navbar';
import Home from "./routes/Home"

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={ <Home /> }/>
      </Routes>
      <Navbar />
    </div>
  );
}

export default App;
